import React from 'react'

const Memento = ({ data, owner }) => {
    console.log(data)
    if (!data.length) {
        return <div className="column"> <article className="message is-warning is-small">
            <div className="message-body">
                You do not have any mementos.
            <a href={"/mementos/" + owner}> click here </a>
                to create one
        </div>
        </article>
        </div>
    } else {
        console.log('???')
        return <div className="column">
            <div id="info" className="columns is-gapless is-multiline is-mobile">
                {data.map(mem => {
                    return <MementoView owner={owner}
                        id={mem.photos[0]}
                        numPhotos={mem.photos.length}
                        title={mem.city}

                    />
                })}
            </div>
        </div>
    }
}

export default Memento
